import React, { Component } from "react";
import PropTypes from "prop-types";

export default class testFile extends Component {
  static propTypes = {
    prop: PropTypes
  };

  render() {
    return (
      <div>
        <h1>Test File testing </h1>
      </div>
    );
  }
}
